import React from "react";

function Header() {
  return (
    <header
      style={{
        backgroundColor: "#87CEEB",
        height: "50px",
        position: "fixed",
        width: "100%",
        top: 0,
      }}
    >
      <nav>
        <ul style={{ listStyleType: "none", margin: 0, padding: 0 }}>
          <li style={{ display: "inline-block", marginLeft: "20px" }}>
            <a href="#">Home</a>
          </li>
          <li style={{ display: "inline-block", marginLeft: "20px" }}>
            <a href="#">About</a>
          </li>
          <li style={{ display: "inline-block", marginLeft: "20px" }}>
            <a href="#">Contact</a>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
